import React, { Component } from "react";
import { Alert, Card, colors } from 'tabler-react';
import C3Chart from "react-c3js";
import './Dashboard.scss';
import {
    BarChart, Bar, Brush, Cell, CartesianGrid, ReferenceLine, ReferenceArea,
    XAxis, YAxis, Tooltip, Legend, ErrorBar, LabelList, Rectangle, LineChart
} from 'recharts';

class Overview extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div className="dashboard">
                <Card
                    title="Card title"
                    body={
                        <LineChart
                            width={400}
                            height={400}
                            data={data}
                            margin={{ top: 5, right: 20, left: 10, bottom: 5 }}
                        >
                            <XAxis dataKey="name" />
                            <Tooltip />
                            <CartesianGrid stroke="#f5f5f5" />
                            <Line type="monotone" dataKey="uv" stroke="#ff7300" yAxisId={0} />
                            <Line type="monotone" dataKey="pv" stroke="#387908" yAxisId={1} />
                        </LineChart>
                    }
                />
                <Card
                    title="Card title"
                    body={`Lorem ipsum dolor sit amet, consectetur adipisicing elit. Aperiam
            deleniti fugit incidunt, iste, itaque minima neque pariatur
            perferendis sed suscipit velit vitae voluptatem. A consequuntur,
            deserunt eaque error nulla temporibus!`}
                />
                <Alert type="warning" isDismissible>
                    Lorem ipsum dolar sit amet, consectetur adipisicing elit.
        </Alert>
            </div>
        )
    }
}

export default Overview;
